import React from 'react';
import ReactDOM from 'react-dom';
import App from "./App";
import { shuffleButton } from './cards';

const rootElement = document.getElementById("root");
ReactDOM.render(
  <React.StrictMode>
    <App />
    <button onClick={shuffleButton}>Shuffle</button>
  </React.StrictMode>,
  rootElement
);
